import React, { Component } from 'react';
import Nav from './Components/nav.jsx';
import Wrapper from './Components/wrapper'
class Main extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div id="wrapper">

                <Nav />

                < Wrapper />
            </div>
        );
    }
}

export default Main;
